import Link from 'next/link'

const Toolbar = () => {
	return (
		<div>
			<div
				className="container"
				style={{
					display: 'flex',
					background: '#F7F7F7',
					alignItems: 'center',
				}}
			>
				<div style={{ margin: '20px', cursor: 'pointer' }}>
					<Link href="/">Home</Link>
				</div>
				<div style={{ margin: '20px', cursor: 'pointer' }}>
					<Link href="/about">About</Link>
				</div>
			</div>
		</div>
	)
}

export default Toolbar
